// src/components/PaymentMethod.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

const PaymentMethod = () => {
  const [paymentMethods, setPaymentMethods] = useState([]);

  useEffect(() => {
    axios.get('/api/paymentMethods')  // Replace with your actual API endpoint
      .then(response => setPaymentMethods(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h2>Payment Methods</h2>
      <table>
        <thead>
          <tr>
            <th>Payment Method ID</th>
            <th>Payment Amount</th>
            <th>Date</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {paymentMethods.map(paymentMethod => (
            <tr key={paymentMethod.paymentMethodId}>
              <td>{paymentMethod.paymentMethodId}</td>
              <td>{paymentMethod.paymentAmount}</td>
              <td>{paymentMethod.paymentDate}</td>
              <td>
                <button>Edit</button>
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default PaymentMethod;
